 (305,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.CantidadSalida * d.PrecioSalida) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'VENTA\'\r\n                            AND YEAR(a.FechaDocumento) = \'2018\'\r\n                            AND a.IDDocumento NOT IN (SELECT e.IDDocumento FROM documentos_cortes e)\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-04 19:05:43'),
 (306,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadSalida,\r\n	                            a.PrecioSalida,\r\n	                            a.UltimoCosto,\r\n	                            a.Excento,\r\n	                            a.Gravado,\r\n	                            a.MontoIva,\r\n	                            a.PagoCuenta,\r\n	                            a.FechaVencimiento,\r\n	                            a.FechaCreacion,\r\n                                a.IDBodega,\r\n                                a.NombreBodega,\r\n	                            c.Categoria,\r\n	                            c.SubCategoria,\r\n	                            (a.CantidadSalida * a.PrecioSalida) as Total,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b,\r\n		                            producto_nombres c\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = c.IDProducto\r\n                            AND b.Operacion = \'VENTA\'\r\n                            AND YEAR(b.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.IDDetalleDocumento;','2018-10-04 19:05:43'),
 (307,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.CantidadEntrada * d.PrecioEntrada) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'INVENTARIO\'\r\n                            AND YEAR(a.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-04 19:05:55'),
 (308,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            a.UltimoCosto,\r\n	                            a.Excento,\r\n	                            a.Gravado,\r\n	                            a.MontoIva,\r\n	                            a.PagoCuenta,\r\n	                            a.FechaVencimiento,\r\n	                            a.FechaCreacion,\r\n                                a.IDBodega,\r\n                                a.NombreBodega,\r\n	                            c.Categoria,\r\n	                            c.SubCategoria,\r\n	                            (a.CantidadEntrada * a.PrecioEntrada) as Total,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b,\r\n		                            producto_nombres c\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = c.IDProducto\r\n                            AND b.Operacion = \'INVENTARIO\'\r\n                            AND YEAR(b.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.IDDetalleDocumento;','2018-10-04 19:05:55'),
 (309,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion,\r\n	                            CONCAT(a.IDPersona,\'-\',IFNULL(a.NIT,\'\'),\'-\',IFNULL(a.DUI,\'\'),\'-\',IFNULL(a.IVA,\'\')) as FullBuscar\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'PROVEEDOR\'\r\n                            ORDER BY a.NombrePersona;','2018-10-04 19:06:00'),
 (310,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-04\' AND \'2018-10-04\'),0) as Entradas,\r\n	                        IFNULL((SELECT SUM(c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-04\' AND \'2018-10-04\'),0) as Salidas,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-04\' AND \'2018-10-04\'),0) as Existencias,\r\n		                     a.UltimoCosto,\r\n		                     IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-04\' AND \'2018-10-04\')*a.UltimoCosto,0) AS TotalInventario\r\n                            FROM producto_nombres a\r\n                            \r\n						    \r\n                            ORDER BY a.NombreProducto;','2018-10-04 19:06:00'),
 (311,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-04\'),0) as Entradas,\r\n	                        IFNULL((SELECT SUM(c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-04\'),0) as Salidas,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-04\'),0) as Existencias,\r\n		                     a.UltimoCosto,\r\n		                     IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-04\')*a.UltimoCosto,0) AS TotalInventario\r\n                            FROM producto_nombres a\r\n                            \r\n						    \r\n                            ORDER BY a.NombreProducto;','2018-10-04 19:06:00'),
 (312,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion,\r\n	                            CONCAT(a.IDPersona,\'-\',IFNULL(a.NIT,\'\'),\'-\',IFNULL(a.DUI,\'\'),\'-\',IFNULL(a.IVA,\'\')) as FullBuscar\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'PROVEEDOR\'\r\n                            ORDER BY a.NombrePersona;','2018-10-04 19:06:28'),
 (313,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Estado,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.PrecioEntrada,\r\n	                            b.CantidadEntrada,\r\n	                            b.PrecioSalida,\r\n	                            b.CantidadSalida,\r\n	                            b.UltimoCosto,	                            \r\n	                            (b.PrecioEntrada * b.CantidadEntrada) as TotalEntrada,\r\n	                            (b.PrecioSalida * b.CantidadSalida) as TotalSalida,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.Operacion = \'ENTRADA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-04\'\r\n                            \r\n                            \r\n                            ORDER BY a.FechaDocumento,a.IDDocumento;','2018-10-04 19:06:29'),
 (314,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.CantidadEntrada * d.PrecioEntrada) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'COMPRA\'\r\n                            AND YEAR(a.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-04 19:06:39'),
 (315,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            a.UltimoCosto,\r\n	                            a.Excento,\r\n	                            a.Gravado,\r\n	                            a.MontoIva,\r\n	                            a.PagoCuenta,\r\n	                            a.FechaVencimiento,\r\n	                            a.FechaCreacion,\r\n                                a.IDBodega,\r\n                                a.NombreBodega,\r\n	                            c.Categoria,\r\n	                            c.SubCategoria,\r\n	                            (a.CantidadEntrada * a.PrecioEntrada) as Total,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b,\r\n		                            producto_nombres c\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = c.IDProducto\r\n                            AND b.Operacion = \'COMPRA\'\r\n                            AND YEAR(b.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.IDDetalleDocumento;','2018-10-04 19:06:40'),
 (316,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion,\r\n	                            CONCAT(a.IDPersona,\'-\',IFNULL(a.NIT,\'\'),\'-\',IFNULL(a.DUI,\'\'),\'-\',IFNULL(a.IVA,\'\')) as FullBuscar\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'PROVEEDOR\'\r\n                            ORDER BY a.NombrePersona;','2018-10-04 19:06:46');
