 (327,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            b.NumeroDocumento,\r\n	                            b.FechaDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            IFNULL(SUM(a.CantidadEntrada),0) AS CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            IFNULL(SUM(a.CantidadSalida),0) AS CantidadSalida,\r\n	                            a.PrecioSalida,\r\n	                            (1.0000*0) AS Existencias,\r\n                                (1.0000*0) AS ValorExistencias,\r\n	                            a.UltimoCosto,\r\n	                            a.FormatoVenta,\r\n	                            a.IDBodega,\r\n	                            a.NombreBodega,\r\n	                            \'SALDO INICIAL\' AS Descripcion\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            \r\n                            AND a.IDBodega = \'1\'\r\n                            AND b.FechaDocumento < \'2018-01-01\'\r\n                            GROUP BY a.IDProducto\r\n\r\n                            UNION\r\n\r\n                            SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            b.NumeroDocumento,\r\n	                            b.FechaDocumento,	\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            a.CantidadSalida,\r\n	                