 (443,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            a.UltimoCosto,\r\n	                            a.Excento,\r\n	                            a.Gravado,\r\n	                            a.MontoIva,\r\n	                            a.PagoCuenta,\r\n	                            a.FechaVencimiento,\r\n	                            a.FechaCreacion,\r\n                                a.IDBodega,\r\n                                a.NombreBodega,\r\n	                            c.Categoria,\r\n	                            c.SubCategoria,\r\n	                            (a.CantidadEntrada * a.PrecioEntrada) as Total,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b,\r\n		                            producto_nombres c\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = c.IDProducto\r\n                            AND b.Operacion = \'COMPRA\'\r\n                            AND YEAR(b.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.IDDetalleDocumento;','2018-10-04 19:44:04'),
 (444,'SELECT IDDocumento,NumeroDocumento,FechaDocumento,FormaPago,DiasPlazo,Operacion,Documento,IDPersona,NombreTitular,Comentario,Estado,FechaCreacion FROM documentos_encabezados a WHERE IDDocumento=\'168\';','2018-10-04 19:44:05'),
