 (481,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                            a.Presentacion,\r\n	                            a.FormatoVenta,\r\n	                            a.PrecioVenta,\r\n	                            a.Precio1,\r\n	                            a.Precio2,\r\n	                            a.Precio3,\r\n                                a.Precio4,\r\n	                            a.UltimoCosto,\r\n	                            a.Existencia,\r\n	                            a.EsGravado,\r\n	                            a.PagoCuenta,\r\n	                            a.TasaIVA,\r\n	                            a.Descontinuado,\r\n	                            a.PuntoVenta,\r\n	                            a.FechaDescontinuado,\r\n	                            a.FechaCreacion,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM producto_nombres a\r\n                            \r\n                            ORDER BY a.NombreProducto;','2018-10-06 12:02:02'),
