 (488,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            DATE_FORMAT(a.FechaDocumento,\'%m-%d-%Y\') AS FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            b.IDDetalleDocumento,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.CantidadSalida,\r\n	                            b.PrecioSalida,\r\n	                            b.UltimoCosto,\r\n	                            b.Excento,\r\n	                            b.Gravado,\r\n	                            b.IvaRetenido,\r\n                                b.MontoIva,\r\n	                            b.PagoCuenta,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega,\r\n	                            (b.CantidadSalida * b.PrecioSalida) as Total,\r\n                                (SELECT a.Ticket_encabezado FROM sistema_configuracion a WHERE a.IDConfiguracion = 1 LIMIT 1) AS TicketEncabezado\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDDocumento = \'172\'\r\n                            ORDER BY b.IDDetalleDocumento;','2018-10-06 12:02:17'),
 (489,'UPDATE caja_configuracion SET Estacion=\'CAJA 1\',TokenTickets=\'10023\',TokenCFiscal=\'8502\',TokenCFinal=\'9501\' WHERE IDCajaConfiguracion=40000;','2018-10-06 12:02:18'),
 (490,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                            a.Presentacion,\r\n	                            a.FormatoVenta,\r\n	                            a.PrecioVenta,\r\n	                            a.Precio1,\r\n	                            a.Precio2,\r\n	                            a.Precio3,\r\n                                a.Precio4,\r\n	                            a.UltimoCosto,\r\n	                            a.Existencia,\r\n	                            a.EsGravado,\r\n	                            a.PagoCuenta,\r\n	                            a.TasaIVA,\r\n	                            a.Descontinuado,\r\n	                            a.PuntoVenta,\r\n	                            a.FechaDescontinuado,\r\n	                            a.FechaCreacion,\r\n                                b.IDBodega,\r\n	                            b.NombreBodega,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n                                SUM(b.CantidadEntrada)-SUM(b.CantidadSalida) AS ExistenciaActual\r\n                            FROM producto_nombres a,\r\n                            		documentos_detalle b\r\n                            WHERE a.PuntoVenta = \'SI\'\r\n                            AND a.IDProducto = b.IDProducto\r\n                            GROUP BY b.IDBodega,a.IDProducto\r\n                            ORDER BY a.NombreProducto;','2018-10-06 12:02:19'),
 (491,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.MontoIva) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'VENTA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.IDDocumento NOT IN (SELECT e.IDDocumento FROM documentos_cortes e)\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-06 12:02:19'),
