 (1511,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.MontoIva) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'VENTA\'\r\n                            AND a.Documento = \'TICKET\'\r\n                            AND YEAR(a.FechaDocumento) = \'2017\'\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-16 10:49:13'),
 (1512,'SELECT \r\n	                                            a.IDUsuario,\r\n	                                            a.NombreCompleto,\r\n	                                            a.Estado,\r\n	                                            a.IDRol,\r\n	                                            a.Rol,\r\n	                                            a.FechaCreacion\r\n                                            FROM usuarios_nombres a\r\n                                            WHERE a.IDUsuario = \'ADMIN\'\r\n                                            AND a.Password = SHA1(\'123\');','2018-10-16 10:50:15'),
 (1513,'SELECT \r\n	                            a.IDPermiso,\r\n	                            a.IDRol,\r\n	                            a.IDComando,\r\n	                            b.NombreComando,\r\n	                            b.Descripcion\r\n                            FROM usuarios_permisos a,\r\n		                            usuarios_comandos b\r\n                            WHERE a.IDComando = b.IDComando\r\n                            AND a.IDRol = \'1\'\r\n                            ORDER BY a.IDPermiso;','2018-10-16 10:50:15'),
 (1514,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                            a.Presentacion,\r\n	                            a.FormatoVenta,\r\n	                            a.PrecioVenta,\r\n	                            a.Precio1,\r\n	                            a.Precio2,\r\n	                            a.Precio3,\r\n                                a.Precio4,\r\n	                            a.UltimoCosto,\r\n	                            a.Existencia,\r\n	                            a.EsGravado,\r\n	                            a.PagoCuenta,\r\n	                            a.TasaIVA,\r\n	                            a.Descontinuado,\r\n	                            a.PuntoVenta,\r\n	                            a.FechaDescontinuado,\r\n	                            a.FechaCreacion,\r\n                                b.IDBodega,\r\n	                            b.NombreBodega,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n                                SUM(b.CantidadEntrada)-SUM(b.CantidadSalida) AS ExistenciaActual\r\n                            FROM producto_nombres a,\r\n                            		documentos_detalle b\r\n                            WHERE a.PuntoVenta = \'SI\'\r\n                            AND a.IDProducto = b.IDProducto\r\n                            GROUP BY b.IDBodega,a.IDProducto\r\n                            ORDER BY a.NombreProducto;','2018-10-16 10:50:25'),
 (1515,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.MontoIva) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'VENTA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.IDDocumento NOT IN (SELECT e.IDDocumento FROM documentos_cortes e)\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-16 10:50:25'),
 (1516,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'CLIENTE\'\r\n                            ORDER BY a.NombrePersona;','2018-10-16 10:50:25'),
