 (1520,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.MontoIva) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'VENTA\'\r\n                            AND a.Documento = \'TICKET\'\r\n                            AND YEAR(a.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-16 10:50:29'),
 (1521,'SELECT IDDocumento,NumeroDocumento,FechaDocumento,FormaPago,DiasPlazo,Operacion,Documento,IDPersona,NombreTitular,Comentario,Estado,FechaCreacion FROM documentos_encabezados a WHERE IDDocumento=\'173\';','2018-10-16 10:50:43'),
 (1522,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadSalida,\r\n	                            a.PrecioSalida,\r\n	                            a.UltimoCosto,\r\n	                            a.Excento,\r\n	                            a.Gravado,\r\n	                            a.MontoIva,\r\n	                            a.PagoCuenta,\r\n	                            a.FechaVencimiento,\r\n	                            a.FechaCreacion,\r\n                                a.IDBodega,\r\n                                a.NombreBodega,\r\n	                            c.Categoria,\r\n	                            c.SubCategoria,\r\n                                a.FormatoVenta,\r\n	                            (a.CantidadSalida * a.PrecioSalida) as Total,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b,\r\n		                            producto_nombres c\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = c.IDProducto\r\n                            AND a.IDDocumento = \'173\'\r\n                            ORDER BY a.IDDetalleDocumento;','2018-10-16 10:50:43'),
 (1523,'SELECT IDProducto,CodigoProducto,NombreProducto,Categoria,SubCategoria,Presentacion,FormatoVenta,PrecioVenta,Precio1,Precio2,Precio3,Precio4,Precio5,Precio6,UltimoCosto,Existencia,EsGravado,PagoCuenta,TasaIVA,Descontinuado,PuntoVenta,FechaDescontinuado,FechaCreacion FROM producto_nombres a WHERE IDProducto=\'695\';','2018-10-16 10:50:43'),
 (1524,'SELECT IDPersona,NombrePersona,Contacto,Pais,NIT,IVA,DUI,Giro,Tipo,Rol,Precio,FechaCreacion FROM personas_nombres a WHERE IDPersona=\'1\';','2018-10-16 10:50:43'),
 (1525,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            DATE_FORMAT(a.FechaDocumento,\'%m-%d-%Y\') AS FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            b.IDDetalleDocumento,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.CantidadSalida,\r\n	                            b.PrecioSalida,\r\n	                            b.UltimoCosto,\r\n	                            b.Excento,\r\n	                            b.Gravado,\r\n	                            b.IvaRetenido,\r\n                                b.MontoIva,\r\n	                            b.PagoCuenta,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega,\r\n	                            (b.CantidadSalida * b.PrecioSalida) as Total,\r\n                                (SELECT a.Ticket_encabezado FROM sistema_configuracion a WHERE a.IDConfiguracion = 1 LIMIT 1) AS TicketEncabezado\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDDocumento = \'173\'\r\n                            ORDER BY b.IDDetalleDocumento;','2018-10-16 10:50:44');
INSERT INTO `migracion_log` (`IDMigracionLog`,`SentenciaSQL`,`FechaCreacion`) VALUES 
 (1526,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                            a.Presentacion,\r\n	                            a.FormatoVenta,\r\n	                            a.PrecioVenta,\r\n	                            a.Precio1,\r\n	                            a.Precio2,\r\n	                            a.Precio3,\r\n                                a.Precio4,\r\n	                            a.UltimoCosto,\r\n	                            a.Existencia,\r\n	                            a.EsGravado,\r\n	                            a.PagoCuenta,\r\n	                            a.TasaIVA,\r\n	                            a.Descontinuado,\r\n	                            a.PuntoVenta,\r\n	                            a.FechaDescontinuado,\r\n	                            a.FechaCreacion,\r\n                                b.IDBodega,\r\n	                            b.NombreBodega,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n                                SUM(b.CantidadEntrada)-SUM(b.CantidadSalida) AS ExistenciaActual\r\n                            FROM producto_nombres a,\r\n                            		documentos_detalle b\r\n                            WHERE a.PuntoVenta = \'SI\'\r\n                            AND a.IDProducto = b.IDProducto\r\n                            GROUP BY b.IDBodega,a.IDProducto\r\n                            ORDER BY a.NombreProducto;','2018-10-16 10:51:13'),
 (1527,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.MontoIva) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'VENTA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.IDDocumento NOT IN (SELECT e.IDDocumento FROM documentos_cortes e)\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-16 10:51:13'),
 (1528,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'CLIENTE\'\r\n                            ORDER BY a.NombrePersona;','2018-10-16 10:51:13'),
 (1529,'SELECT IDBodega,NombreBodega FROM bodegas_nombres a WHERE IDBodega=\'1\';','2018-10-16 10:51:14'),
 (1530,'SELECT IDPersona,NombrePersona,Contacto,Pais,NIT,IVA,DUI,Giro,Tipo,Rol,Precio,FechaCreacion FROM personas_nombres a WHERE IDPersona=\'1\';','2018-10-16 10:51:14'),
 (1531,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion,\r\n	                            CONCAT(a.IDPersona,\'-\',IFNULL(a.NIT,\'\'),\'-\',IFNULL(a.DUI,\'\'),\'-\',IFNULL(a.IVA,\'\')) as FullBuscar\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'PROVEEDOR\'\r\n                            ORDER BY a.NombrePersona;','2018-10-16 10:51:32'),
 (1532,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-16\' AND \'2018-10-16\'),0) as Entradas,\r\n	                        IFNULL((SELECT SUM(c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-16\' AND \'2018-10-16\'),0) as Salidas,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-16\' AND \'2018-10-16\'),0) as Existencias,\r\n		                     a.UltimoCosto,\r\n		                     IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-10-16\' AND \'2018-10-16\')*a.UltimoCosto,0) AS TotalInventario\r\n                            FROM producto_nombres a\r\n                            \r\n						    \r\n                            ORDER BY a.NombreProducto;','2018-10-16 10:51:32'),
 (1533,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'),0) as Entradas,\r\n	                        IFNULL((SELECT SUM(c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'),0) as Salidas,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'),0) as Existencias,\r\n		                     a.UltimoCosto,\r\n		                     IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\')*a.UltimoCosto,0) AS TotalInventario\r\n                            FROM producto_nombres a\r\n                            \r\n						    \r\n                            ORDER BY a.NombreProducto;','2018-10-16 10:51:32'),
 (1534,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'),0) as Entradas,\r\n	                        IFNULL((SELECT SUM(c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'),0) as Salidas,\r\n	                        IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'),0) as Existencias,\r\n		                     a.UltimoCosto,\r\n		                     IFNULL((SELECT SUM(c.CantidadEntrada - c.CantidadSalida) \r\n		                        FROM documentos_detalle c, documentos_encabezados d \r\n		                        WHERE c.IDDocumento = d.IDDocumento \r\n		                        AND c.IDProducto = a.IDProducto \r\n		                        AND d.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\')*a.UltimoCosto,0) AS TotalInventario\r\n                            FROM producto_nombres a\r\n                            \r\n						    \r\n                            ORDER BY a.NombreProducto;','2018-10-16 10:51:51'),
 (1535,'SELECT \r\n	                            a.Descripcion,\r\n	                            IFNULL((SELECT MIN(d.NumeroDocumento) \r\n			                            FROM documentos_encabezados d,\r\n					                            documentos_detalle c,\r\n					                            documentos_log e\r\n			                            WHERE d.IDDocumento = c.IDDocumento\r\n			                            AND d.Documento = a.Documento\r\n			                            AND d.Estado = a.Estado\r\n			                            AND d.IDDocumento = e.IDDocumento\r\n			                            AND e.Estacion = \'CAJA 1\'\r\n			                            AND d.FechaDocumento BETWEEN \'2018-10-16\' AND \'2018-10-16\'),NULL) AS NumeroInicial,\r\n	                            IFNULL((SELECT MAX(d.NumeroDocumento) \r\n			                            FROM documentos_encabezados d,\r\n					                            documentos_detalle c,\r\n					                            documentos_log e\r\n			                            WHERE d.IDDocumento = c.IDDocumento\r\n			                            AND d.Documento = a.Documento\r\n			                            AND d.Estado = a.Estado\r\n			                            AND d.IDDocumento = e.IDDocumento			\r\n			                            AND e.Estacion = \'CAJA 1\'\r\n			                            AND d.FechaDocumento BETWEEN \'2018-10-16\' AND \'2018-10-16\'),NULL) AS NumeroFinal,\r\n	                            IFNULL((SELECT SUM(c.MontoIva) \r\n			                            FROM documentos_encabezados d,\r\n					                            documentos_detalle c,\r\n					                            documentos_log e\r\n			                            WHERE d.IDDocumento = c.IDDocumento\r\n			                            AND d.Documento = a.Documento\r\n			                            AND d.Estado = a.Estado\r\n			                            AND d.IDDocumento = e.IDDocumento			\r\n			                            AND e.Estacion = \'CAJA 1\'\r\n			                            AND d.FechaDocumento BETWEEN \'2018-10-16\' AND \'2018-10-16\'),0) AS Monto				\r\n                            FROM cortes_plantilla a\r\n                            ORDER BY a.Descripcion;','2018-10-16 10:52:01'),
 (1536,'SELECT \r\n	                            a.Descripcion,\r\n	                            IFNULL((SELECT MIN(d.NumeroDocumento) \r\n			                            FROM documentos_encabezados d,\r\n					                            documentos_detalle c,\r\n					                            documentos_log e\r\n			                            WHERE d.IDDocumento = c.IDDocumento\r\n			                            AND d.Documento = a.Documento\r\n			                            AND d.Estado = a.Estado\r\n			                            AND d.IDDocumento = e.IDDocumento\r\n			                            AND e.Estacion = \'CAJA 1\'\r\n			                            AND d.FechaDocumento BETWEEN \'2018-10-01\' AND \'2018-10-31\'),NULL) AS NumeroInicial,\r\n	                            IFNULL((SELECT MAX(d.NumeroDocumento) \r\n			                            FROM documentos_encabezados d,\r\n					                            documentos_detalle c,\r\n					                            documentos_log e\r\n			                            WHERE d.IDDocumento = c.IDDocumento\r\n			                            AND d.Documento = a.Documento\r\n			                            AND d.Estado = a.Estado\r\n			                            AND d.IDDocumento = e.IDDocumento			\r\n			                            AND e.Estacion = \'CAJA 1\'\r\n			                            AND d.FechaDocumento BETWEEN \'2018-10-01\' AND \'2018-10-31\'),NULL) AS NumeroFinal,\r\n	                            IFNULL((SELECT SUM(c.MontoIva) \r\n			                            FROM documentos_encabezados d,\r\n					                            documentos_detalle c,\r\n					                            documentos_log e\r\n			                            WHERE d.IDDocumento = c.IDDocumento\r\n			                            AND d.Documento = a.Documento\r\n			                            AND d.Estado = a.Estado\r\n			                            AND d.IDDocumento = e.IDDocumento			\r\n			                            AND e.Estacion = \'CAJA 1\'\r\n			                            AND d.FechaDocumento BETWEEN \'2018-10-01\' AND \'2018-10-31\'),0) AS Monto				\r\n                            FROM cortes_plantilla a\r\n                            ORDER BY a.Descripcion;','2018-10-16 10:52:17'),
 (1537,'SELECT IDBodega,NombreBodega FROM bodegas_nombres a WHERE IDBodega > 0 ORDER BY NombreBodega;','2018-10-16 10:52:37'),
 (1538,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion,\r\n	                            CONCAT(a.IDPersona,\'-\',IFNULL(a.NIT,\'\'),\'-\',IFNULL(a.DUI,\'\'),\'-\',IFNULL(a.IVA,\'\')) as FullBuscar\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'PROVEEDOR\'\r\n                            ORDER BY a.NombrePersona;','2018-10-16 10:52:43'),
 (1539,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Estado,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.PrecioEntrada,\r\n	                            b.CantidadEntrada,\r\n	                            b.PrecioSalida,\r\n	                            b.CantidadSalida,\r\n	                            b.UltimoCosto,	                            \r\n	                            (b.PrecioEntrada * b.CantidadEntrada) as TotalEntrada,\r\n	                            (b.PrecioSalida * b.CantidadSalida) as TotalSalida,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.Operacion = \'COMPRA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'\r\n                            \r\n                            \r\n                            ORDER BY a.FechaDocumento,a.IDDocumento;','2018-10-16 10:52:44'),
 (1540,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Estado,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.PrecioEntrada,\r\n	                            b.CantidadEntrada,\r\n	                            b.PrecioSalida,\r\n	                            b.CantidadSalida,\r\n	                            b.UltimoCosto,	                            \r\n	                            (b.PrecioEntrada * b.CantidadEntrada) as TotalEntrada,\r\n	                            (b.PrecioSalida * b.CantidadSalida) as TotalSalida,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.Operacion = \'VENTA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'\r\n                            \r\n                            \r\n                            ORDER BY a.FechaDocumento,a.IDDocumento;','2018-10-16 10:53:04'),
 (1541,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Estado,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.PrecioEntrada,\r\n	                            b.CantidadEntrada,\r\n	                            b.PrecioSalida,\r\n	                            b.CantidadSalida,\r\n	                            b.UltimoCosto,	                            \r\n	                            (b.PrecioEntrada * b.CantidadEntrada) as TotalEntrada,\r\n	                            (b.PrecioSalida * b.CantidadSalida) as TotalSalida,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.Operacion = \'INVENTARIO\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'\r\n                            \r\n                            \r\n                            ORDER BY a.FechaDocumento,a.IDDocumento;','2018-10-16 10:53:12'),
 (1542,'SELECT \r\n	                            a.IDPersona,\r\n	                            a.NombrePersona,\r\n	                            a.Contacto,\r\n	                            a.Tipo,\r\n	                            a.Rol,\r\n                                a.Precio,\r\n	                            a.Pais,\r\n	                            a.NIT,\r\n	                            a.IVA,\r\n	                            a.DUI,\r\n	                            a.Giro,\r\n	                            a.FechaCreacion\r\n                            FROM personas_nombres a\r\n                            WHERE a.Rol = \'CLIENTE\'\r\n                            ORDER BY a.NombrePersona;','2018-10-16 10:53:35'),
 (1543,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Estado,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.PrecioEntrada,\r\n	                            b.CantidadEntrada,\r\n	                            b.PrecioSalida,\r\n	                            b.CantidadSalida,\r\n	                            b.UltimoCosto,	                            \r\n	                            (b.PrecioEntrada * b.CantidadEntrada) as TotalEntrada,\r\n	                            (b.PrecioSalida * b.CantidadSalida) as TotalSalida,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.Operacion = \'SALIDA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'\r\n                            \r\n                            \r\n                            ORDER BY a.FechaDocumento,a.IDDocumento;','2018-10-16 10:53:41'),
 (1544,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Estado,\r\n	                            b.IDProducto,\r\n	                            b.CodigoProducto,\r\n	                            b.NombreProducto,\r\n	                            b.PrecioEntrada,\r\n	                            b.CantidadEntrada,\r\n	                            b.PrecioSalida,\r\n	                            b.CantidadSalida,\r\n	                            b.UltimoCosto,	                            \r\n	                            (b.PrecioEntrada * b.CantidadEntrada) as TotalEntrada,\r\n	                            (b.PrecioSalida * b.CantidadSalida) as TotalSalida,\r\n	                            b.IDBodega,\r\n	                            b.NombreBodega\r\n                            FROM documentos_encabezados a,\r\n		                            documentos_detalle b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.Operacion = \'VENTA\'\r\n                            AND a.Estado = \'APLICADO\'\r\n                            AND a.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'\r\n                            \r\n                            \r\n                            ORDER BY a.FechaDocumento,a.IDDocumento;','2018-10-16 10:53:48'),
 (1545,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                            a.Presentacion,\r\n	                            a.FormatoVenta,\r\n	                            a.PrecioVenta,\r\n	                            a.Precio1,\r\n	                            a.Precio2,\r\n	                            a.Precio3,\r\n                                a.Precio4,\r\n	                            a.UltimoCosto,\r\n	                            a.Existencia,\r\n	                            a.EsGravado,\r\n	                            a.PagoCuenta,\r\n	                            a.TasaIVA,\r\n	                            a.Descontinuado,\r\n	                            a.PuntoVenta,\r\n	                            a.FechaDescontinuado,\r\n	                            a.FechaCreacion,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM producto_nombres a\r\n                            \r\n                            ORDER BY a.NombreProducto;','2018-10-16 10:54:13'),
 (1546,'SELECT IDBodega,NombreBodega FROM bodegas_nombres a WHERE IDBodega > 0 ORDER BY IDBodega;','2018-10-16 10:54:30'),
 (1547,'SELECT \r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.Categoria,\r\n	                            a.SubCategoria,\r\n	                            a.Presentacion,\r\n	                            a.FormatoVenta,\r\n	                            a.UltimoCosto,\r\n                                b.IDBodega,\r\n	                            b.NombreBodega,\r\n	                            SUM(b.CantidadEntrada) AS Entradas,\r\n	                            SUM(b.CantidadSalida) AS Salidas,\r\n                                SUM(b.CantidadEntrada)-SUM(b.CantidadSalida) AS ExistenciaActual\r\n                            FROM producto_nombres a,\r\n                            		documentos_detalle b,\r\n                            		documentos_encabezados c\r\n                            WHERE a.IDProducto = b.IDProducto\r\n                            AND b.IDDocumento = c.IDDocumento\r\n                            AND b.IDBodega = \'1\'\r\n                            AND c.FechaDocumento BETWEEN \'2018-01-01\' AND \'2018-10-16\'\r\n                            GROUP BY b.IDBodega,a.IDProducto\r\n                            ORDER BY a.NombreProducto;','2018-10-16 10:54:33'),
 (1548,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.CantidadEntrada * d.PrecioEntrada) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'COMPRA\'\r\n                            AND YEAR(a.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-16 10:54:51'),
 (1549,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            a.UltimoCosto,\r\n	                            a.Excento,\r\n	                            a.Gravado,\r\n	                            a.MontoIva,\r\n	                            a.PagoCuenta,\r\n	                            a.FechaVencimiento,\r\n	                            a.FechaCreacion,\r\n                                a.IDBodega,\r\n                                a.NombreBodega,\r\n	                            c.Categoria,\r\n	                            c.SubCategoria,\r\n	                            (a.CantidadEntrada * a.PrecioEntrada) as Total,\r\n                                CONCAT(a.CodigoProducto,a.NombreProducto) AS FullBusqueda\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b,\r\n		                            producto_nombres c\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = c.IDProducto\r\n                            AND b.Operacion = \'COMPRA\'\r\n                            AND YEAR(b.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.IDDetalleDocumento;','2018-10-16 10:54:51'),
 (1550,'SELECT IDPersona,NombrePersona,Contacto,Pais,NIT,IVA,DUI,Giro,Tipo,Rol,Precio,FechaCreacion FROM personas_nombres a WHERE IDPersona=\'0\';','2018-10-16 10:54:53'),
