 (1554,'INSERT INTO documentos_encabezados (NumeroDocumento,FechaDocumento,FormaPago,DiasPlazo,Operacion,Documento,IDPersona,NombreTitular,Comentario,Estado) VALUES (\'12562626\',\'16/10/2018 10:54:53\',\'CONTADO\',\'0\',\'COMPRA\',\'CREDITO FISCAL\',\'477\',\'PROVEEDORES VARIOS\',\'COMPRA DEL MES\',\'APLICADO\');','2018-10-16 10:55:08'),
 (1555,'SELECT \r\n	                            a.IDDocumento,\r\n	                            a.NumeroDocumento,\r\n	                            a.FechaDocumento,\r\n	                            a.FormaPago,\r\n	                            a.DiasPlazo,\r\n	                            a.Operacion,\r\n	                            a.Documento,\r\n	                            a.IDPersona,\r\n	                            a.NombreTitular,\r\n	                            a.Comentario,\r\n	                            a.Estado,\r\n	                            a.FechaCreacion,\r\n	                            (SELECT COUNT(d.IDDetalleDocumento) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento) AS Items,\r\n	                            IFNULL((SELECT SUM(d.CantidadEntrada * d.PrecioEntrada) \r\n		                            FROM documentos_detalle d \r\n		                            WHERE d.IDDocumento = a.IDDocumento),0) AS Total\r\n                            FROM documentos_encabezados a\r\n                            WHERE a.Operacion = \'COMPRA\'\r\n                            AND YEAR(a.FechaDocumento) = \'2018\'\r\n                            ORDER BY a.FechaCreacion DESC;','2018-10-16 10:55:08'),
