 (1582,'SELECT IDProducto,CodigoProducto,NombreProducto,Categoria,SubCategoria,Presentacion,FormatoVenta,PrecioVenta,Precio1,Precio2,Precio3,Precio4,Precio5,Precio6,UltimoCosto,Existencia,EsGravado,PagoCuenta,TasaIVA,Descontinuado,PuntoVenta,FechaDescontinuado,FechaCreacion FROM producto_nombres a WHERE IDProducto=\'1\';','2018-10-16 10:57:12'),
 (1583,'SELECT IDBodega,NombreBodega FROM bodegas_nombres a WHERE IDBodega=\'0\';','2018-10-16 10:57:12'),
 (1584,'SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            b.NumeroDocumento,\r\n	                            b.FechaDocumento,\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            IFNULL(SUM(a.CantidadEntrada),0) AS CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            IFNULL(SUM(a.CantidadSalida),0) AS CantidadSalida,\r\n	                            a.PrecioSalida,\r\n	                            (1.0000*0) AS Existencias,\r\n                                (1.0000*0) AS ValorExistencias,\r\n	                            a.UltimoCosto,\r\n	                            a.FormatoVenta,\r\n	                            a.IDBodega,\r\n	                            a.NombreBodega,\r\n	                            \'SALDO INICIAL\' AS Descripcion\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = \'1\'\r\n                            \r\n                            AND b.FechaDocumento BETWEEN \'2018-10-01\' AND \'2018-10-31\'\r\n                            AND b.Operacion = \'INVENTARIO\'\r\n                            GROUP BY a.IDProducto\r\n\r\n                            UNION\r\n\r\n                            SELECT \r\n	                            a.IDDetalleDocumento,\r\n	                            a.IDDocumento,\r\n	                            b.NumeroDocumento,\r\n	                            b.FechaDocumento,	\r\n	                            a.IDProducto,\r\n	                            a.CodigoProducto,\r\n	                            a.NombreProducto,\r\n	                            a.CantidadEntrada,\r\n	                            a.PrecioEntrada,\r\n	                            a.CantidadSalida,\r\n	                            a.PrecioSalida,\r\n	                            (1.0000*0) AS Existencias,\r\n                                (1.0000*0) AS ValorExistencias,\r\n	                            a.UltimoCosto,\r\n	                            a.FormatoVenta,\r\n	                            a.IDBodega,\r\n	                            a.NombreBodega,	\r\n	                            \'MOVIMIENTOS\' AS Descripcion	\r\n                            FROM documentos_detalle a,\r\n		                            documentos_encabezados b\r\n                            WHERE a.IDDocumento = b.IDDocumento\r\n                            AND a.IDProducto = \'1\'\r\n                            \r\n                            AND b.FechaDocumento BETWEEN \'2018-10-01\' AND \'2018-10-31\'\r\n                            AND b.Operacion NOT IN (\'INVENTARIO\')\r\n                            ORDER BY 4 ASC;','2018-10-16 10:57:13');
